import logoAdmin from "@assets/images/logo-admin.png";
import Navbar from "@components/nav";


const HomePage = () => {
  return (
    <div className="w-[100vw] h-[100vh] relative">
      <div className="navbar w-[100vw] h-[10%] bg-[#394449] shadow-2xl absolute"></div>
      <div className="navbar w-[15%] h-[100vh] bg-[#394449] shadow-2xl absolute z-50">
        <div className="logo">
          <img src={logoAdmin} alt="" className="mt-2 w-" />
        </div>
        <Navbar></Navbar>
      </div>
    </div>
  );
};
export default HomePage;
